import React, { useState, useEffect } from 'react';
import axios from 'axios';

const CreateTask = () => {
  const [formData, setFormData] = useState({
    title: '',
    description: '',
    assignedTo: '',
    status: 'To Do',
    priority: 'Medium',
    dueDate: ''
  });
  const [users, setUsers] = useState([]);
  const [assignedUsers, setAssignedUsers] = useState([]);

  useEffect(() => {
    const fetchUsers = async () => {
      try {
        const res = await axios.get('http://localhost:5000/api/users');
        setUsers(res.data);
      } catch (error) {
        console.error(error.response.data);
      }
    };
    fetchUsers();
  }, []);

  const handleInputChange = e => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleAssignUser = userId => {
    if (!assignedUsers.includes(userId)) {
      setAssignedUsers([...assignedUsers, userId]);
    }
  };

  const handleSubmit = async e => {
    e.preventDefault();
    try {
      const res = await axios.post('http://localhost:5000/api/tasks/create', formData);
      console.log(res.data);
      // Reset form fields
      setFormData({
        title: '',
        description: '',
        assignedTo: '',
        status: 'To Do',
        priority: 'Medium',
        dueDate: ''
      });
    } catch (error) {
      console.error(error.response.data);
    }
  };

  return (
    <div>
      <h2>Create New Task</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Title:</label>
          <input type="text" name="title" value={formData.title} onChange={handleInputChange} required />
        </div>
        <div>
          <label>Description:</label>
          <textarea name="description" value={formData.description} onChange={handleInputChange} required />
        </div>
        <div>
          <label>Assigned To:</label>
          <select name="assignedTo" value={formData.assignedTo} onChange={handleInputChange}>
            <option value="">Select User</option>
            {users.map(user => (
              <option key={user._id} value={user._id} onClick={() => handleAssignUser(user._id)}>
                {user.username}
              </option>
            ))}
          </select>
        </div>
        <div>
          <label>Status:</label>
          <select name="status" value={formData.status} onChange={handleInputChange}>
            <option value="To Do">To Do</option>
            <option value="In Progress">In Progress</option>
            <option value="Done">Done</option>
          </select>
        </div>
        <div>
          <label>Priority:</label>
          <select name="priority" value={formData.priority} onChange={handleInputChange}>
            <option value="Low">Low</option>
            <option value="Medium">Medium</option>
            <option value="High">High</option>
          </select>
        </div>
        <div>
          <label>Due Date:</label>
          <input type="date" name="dueDate" value={formData.dueDate} onChange={handleInputChange} required />
        </div>
        <button type="submit">Create Task</button>
      </form>
    </div>
  );
};

export default CreateTask;
